import React from 'react';
import TrendCard from './TrendCard'; // Adjust the path as needed
import styled from 'styled-components';

const Container = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr)); /* Adjust column width as needed */
  gap: 20px; /* Adjust gap between cards */
  padding: 20px;
`;

const LikedTrendsPage = ({ likedTrends }) => {
  // Ensure uniqueness using Set
  const uniqueLikedTrends = Array.from(new Set(likedTrends.map(trend => trend.name)))
    .map(name => {
      return likedTrends.find(trend => trend.name === name);
    });

  return (
    <Container>
      {uniqueLikedTrends.map((trend, index) => (
        <TrendCard key={index} trend={trend} swipeDirection={null} />
      ))}
    </Container>
  );
};

export default LikedTrendsPage;
